import React,{Component} from 'react';

export class Todo extends Component {

    constructor(props) {
        super(props);
    }   

    render() {
        return ( 
            <div >
                <h2>{this.props.text}</h2>
                <h2>{this.props.priority}</h2> 
                <h2>{this.props.dueDate.toString()}</h2>
            </div> 
        );
    }
}
export default Todo;
